import React, { useEffect, useState } from 'react'

const Products = () => {
    const [state , setState] = useState([])
    

    useEffect(()=>{
      const product = async ()=>{
          let res = await fetch('https://dummyjson.com/products')
          const data = await res.json()
          setState(data)
      }
      product()
    })
  return (
    <div>Products</div>
  )
}

export default Products
